create table USERS (
	id INT,
	first_name VARCHAR(150),
	last_name VARCHAR(150),
	avatar VARCHAR(250),
	email VARCHAR(100),
	gender VARCHAR(50),
	ip_address VARCHAR(20),
	company VARCHAR(150)
);

SET character_set_client = utf8;
SET character_set_connection = utf8;
SET character_set_results = utf8;
SET collation_connection = utf8_general_ci;

